import React, { useContext } from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';

import { ThemeContext } from './contexts/ThemeContext';
import { Main, BlogPage, ProjectPage, LeadershipPage, Navbar } from './pages'; // Make sure Navbar is imported
import { BackToTop } from './components';
import ScrollToTop from './utils/ScrollToTop';

import './App.css';
import AchievementsPage from './pages/Achievements/AchievementsPage';

function App() {
  const { theme } = useContext(ThemeContext);

  console.log("%cDEVELOPER PORTFOLIO", `color:${theme.primary}; font-size:50px`);
  console.log("%chttps://github.com/hhhrrrttt222111/developer-portfolio", `color:${theme.tertiary}; font-size:20px`);

  return (
    <div className="app">
      <Router>
        <ScrollToTop />
        <Navbar /> {/* Navbar is placed here to be constant on every page */}
        <Switch>
          <Route path="/" exact component={Main} />
          <Route path="/blog" exact component={BlogPage} />
          <Route path="/projects" exact component={ProjectPage} />
          <Route path="/achievements" exact component={AchievementsPage} />
          <Route path="/leaderships" exact component={LeadershipPage} />
          <Redirect to="/" />
        </Switch>
      </Router>
      <BackToTop />
    </div>
  );
}

export default App;
